import { StatusBar } from 'expo-status-bar';
import { Alert, StyleSheet, Text, TouchableHighlight, TouchableNativeFeedback, View } from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>
      <TouchableNativeFeedback onPress={() => Alert.alert('Hola juan')} >
        <Text style={styles.Text}>Hola Youtuber</Text>
      </TouchableNativeFeedback>
      <TouchableHighlight>

      </TouchableHighlight>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  Text: {
    color: '#000'

  }
});
